// DeleteUniqueIndexCache 删除索引存在的缓存
func (m *MallActivationCodeRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.MallActivationCode) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, m.cache.Key(CacheMallActivationCodeByConditionPrefix))
	keys = append(keys, m.cache.Key(CacheMallActivationCodeUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[m.cache.Key(CacheMallActivationCodeByIDPrefix, item.ID)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallActivationCodeUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallActivationCodeByCodePrefix, item.Code)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallActivationCodeUnscopedByCodePrefix, item.Code)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallActivationCodeByStatusPrefix, item.Status)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallActivationCodeUnscopedByStatusPrefix, item.Status)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallActivationCodeByUserIDPrefix, item.UserID)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallActivationCodeUnscopedByUserIDPrefix, item.UserID)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := m.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
